/*****************************************************************************/
-- create INRIX schema and tables

-- schemas
CREATE SCHEMA [inrix]
GO


-- INRIX holiday date table
CREATE TABLE [inrix].[holiday] (
	[date] date NOT NULL,
	[holiday] char(50) NOT NULL,
	[type] char(20) NOT NULL,
    INDEX [ccsi_inrix_holiday] CLUSTERED COLUMNSTORE,
    CONSTRAINT [ixuq_inrix_holiday] UNIQUE ([date], [holiday])
    )
GO

-- INRIX speed dataset pre-2017 data
CREATE TABLE [inrix].[speed_data_pre2017] (
	[tmc_code] nvarchar(50) NOT NULL,
	[measurement_tstamp] datetime NOT NULL,
    [speed] float NOT NULL,
    [average_speed] float NULL,
    [reference_speed] float NOT NULL,
    [travel_time_minutes] float NULL,
    [confidence_score] float NOT NULL,
    [cvalue] float NULL,
    INDEX [ccsi_speed_data_pre2017] CLUSTERED COLUMNSTORE
    )
GO

-- INRIX 1-minute time period cross-reference
CREATE TABLE [inrix].[time_min1_xref] (
    [min1] smallint NOT NULL,
	[min1_period_start] time NOT NULL,
	[min1_period_end] time NOT NULL,
	[min5] smallint NOT NULL,
	[min5_period_start] time NOT NULL,
	[min5_period_end] time NOT NULL,
	[min15] tinyint NOT NULL,
	[min15_period_start] time NOT NULL,
	[min15_period_end] time NOT NULL,
	[min30] tinyint NOT NULL,
	[min30_period_start] time NOT NULL,
	[min30_period_end] time NOT NULL,
	[abm_half_hour] tinyint NOT NULL,
	[abm_half_hour_period_start] time NOT NULL,
	[abm_half_hour_period_end] time NOT NULL,
	[min60] tinyint NOT NULL,
	[min60_period_start] time NOT NULL,
	[min60_period_end] time NOT NULL,
	[abm_5_tod] tinyint NOT NULL,
	[abm_5_tod_period_start] time NOT NULL,
	[abm_5_tod_period_end] time NOT NULL,
	[day] tinyint NOT NULL,
	[day_period_start] time NOT NULL,
	[day_period_end] time NOT NULL,
    INDEX [ccsi_inrix_time_min1_xref] CLUSTERED COLUMNSTORE,
    CONSTRAINT [ixuq_inrix_time_min1_xref] UNIQUE ([min1])
    )
GO

-- INRIX pre-2017 TMC metadata table
CREATE TABLE [inrix].[tmc_metadata_pre2017] (
	[metadata_date] date NOT NULL,
	[tmc_code] nvarchar(50) NOT NULL,
	[road] nvarchar(100) NULL,
    [direction] nvarchar(25) NOT NULL,
    [intersection] nvarchar(100) NOT NULL,
    [state] nvarchar(25) NOT NULL,
    [county] nvarchar(50) NOT NULL,
    [zip] int NULL,
    [miles] float NOT NULL,
    [road_order] float NOT NULL,
    [shape] geometry NULL,  -- allow NULLs
    CONSTRAINT [pk_tmc_metadata_pre2017] PRIMARY KEY ([metadata_date], [tmc_code])
    )
WITH (DATA_COMPRESSION = PAGE)
GO

-- create manual lookup table of pre 2016 TMC links
-- and SANDAGs 2015 highway coverage links
CREATE TABLE [inrix].[highway_coverage_xref_pre2017] (
	[tmc_code] nvarchar(50) NOT NULL,
	[hwycov_id] integer NOT NULL,
    [tmc_length] float NOT NULL,
    [overlap_length] float NOT NULL,
    [overlap_proportion] float NOT NULL,
    CONSTRAINT [pk_highway_coverage_xref_pre2017] PRIMARY KEY ([tmc_code], [hwycov_id])
    )
WITH (DATA_COMPRESSION = PAGE)
GO